/* ===== src/pages/Tutor/TutorHome.jsx ===== */
import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';
import { Container, Row, Col, Card, ListGroup, Button } from 'react-bootstrap';

export default function TutorHome() {
  const navigate = useNavigate();
  const [tutor, setTutor] = useState(null);
  const [meusPets, setMeusPets] = useState([]);
  const [meusEventos, setMeusEventos] = useState([]);
  const [filtroPet, setFiltroPet] = useState(null);

  useEffect(() => {
    const usuarioStr = localStorage.getItem('usuario_tutor');
    if (!usuarioStr) {
      alert('Você precisa estar logado como tutor.');
      navigate('/login-tutor');
      return;
    }
    const usuario = JSON.parse(usuarioStr);
    setTutor(usuario);

    api.get('/pets')
      .then(res => {
        const petsFiltrados = res.data.filter(p => p.tutor === usuario._id);
        setMeusPets(petsFiltrados);
      })
      .catch(() => alert('Erro ao buscar pets'));
  }, [navigate]);

  useEffect(() => {
    (async () => {
      try {
        const eventosPorPet = await Promise.all(
          meusPets.map(pet =>
            api.get(`/eventos?pet=${pet._id}`)
               .then(res => res.data.map(evt => ({ ...evt, petName: pet.nome })))
          )
        );
        const allEventos = eventosPorPet.flat()
          .sort((a, b) => new Date(b.dataEntrada) - new Date(a.dataEntrada));
        setMeusEventos(allEventos);
      } catch {
        alert('Erro ao buscar eventos');
      }
    })();
  }, [meusPets]);

  const formatDateTime = iso => new Date(iso).toLocaleString('pt-BR');

  if (!tutor) return <p>Carregando perfil...</p>;

  const eventosExibidos = filtroPet
    ? meusEventos.filter(evt => evt.pet === filtroPet)
    : meusEventos;

  const handleLogout = () => {
    localStorage.removeItem('usuario_tutor');
    navigate('/login-tutor');
  };

  return (
    <Container className="mt-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Painel do Tutor</h2>
        <Button variant="secondary" onClick={handleLogout}>Sair</Button>
      </div>

      <Row>
        <Col md={4}>
          <Card className="mb-4">
            <Card.Header>Meus Pets</Card.Header>
            <ListGroup variant="flush">
              <ListGroup.Item
                className={!filtroPet ? 'active' : ''}
                style={{ cursor: 'pointer' }}
                onClick={() => setFiltroPet(null)}
              >
                Todos Pets
              </ListGroup.Item>
              {meusPets.map(pet => (
                <ListGroup.Item
                  key={pet._id}
                  className={filtroPet === pet._id ? 'active' : ''}
                  style={{ cursor: 'pointer' }}
                  onClick={() => setFiltroPet(pet._id)}
                >
                  {pet.nome}
                </ListGroup.Item>
              ))}
            </ListGroup>
          </Card>
        </Col>

        <Col md={8}>
          <Card>
            <Card.Header className="d-flex justify-content-between align-items-center">
              <span>Meus Eventos</span>
              <Link to="/pets">Ver Pets</Link>
            </Card.Header>
            <ListGroup variant="flush">
              {eventosExibidos.length === 0 ? (
                <ListGroup.Item>Nenhum evento registrado.</ListGroup.Item>
              ) : (
                eventosExibidos.map(evt => (
                  <ListGroup.Item key={evt._id} className="mb-3">
                    <div className="d-flex justify-content-between">
                      <div>
                        <strong>{evt.tipo}</strong> — <em>{evt.petName}</em>
                      </div>
                      <div>
                        <small>
                          Entrada: {formatDateTime(evt.dataEntrada)}<br />
                          Saída: {evt.dataSaida ? formatDateTime(evt.dataSaida) : 'Em andamento'}<br />
                          Status: {evt.status || (evt.dataSaida ? 'Finalizado' : 'Ativo')}
                        </small>
                      </div>
                    </div>
                    {evt.status === 'Ativo' && (
                      <Button
                        variant="warning"
                        size="sm"
                        className="mt-2"
                        onClick={() => navigate(`/pets/${evt.pet}/finalizar-evento/${evt._id}`)}
                      >
                        Finalizar Evento
                      </Button>
                    )}
                  </ListGroup.Item>
                ))
              )}
            </ListGroup>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}
